export class MainHeader extends Component {
  render() {
    const headerStyle = {
      background: "#5e438d",
      color: "#fff",
      textAlign: "center",
      padding: "10px",
    };
    return (
      <header style={headerStyle}>
        <h1>Newsletter</h1>
        <form>
          Username<input type="text"></input> Password
          <input type="password"></input> <button type="submit">Login</button>
        </form>
      </header>
    );
  }
}

export default MainHeader;
